import React from 'react'

const Booklist = (props) => {

	return (
		<div>
			<h3>Your books</h3>
    		<ul>
    			<li>{props.books[0].name} {props.books[0].PagesRead/props.books[0].pages} %</li>
    			<li>{props.books[1].name} {} %</li>
    		</ul>
		</div>
	);
}

export default Booklist
